MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "");
MGCAddSnippet(3, "The Calibre 3DSTACK application enables you to verify designs containing flip chips, Through Silicon Vias (TSVs), and other 2.5D and 3D-IC configurations. ");
MGCAddSnippet(4, "Traditional ICs are self-contained and are verified at the chip-level using Calibre nmDRC, Calibre nmLVS, Calibre RVE, and Calibre DESIGNrev. 3D-ICs consist of multiple stacked chips with connectivity achieved through traces on an interposer or with special vias or bumps. The Calibre 3DSTACK tool verifies the interfaces between these chips, which may consist of black box IP.");
MGCAddSnippet(5, "You must adhere to specific requirements with respect to the usage of the rule file language used in the Calibre 3DSTACK tool.");
MGCAddSnippet(6, "Before running the Calibre 3DSTACK tool, you must have a full Calibre installation and the appropriate licenses. The chips in your stack must already be DRC and LVS clean.");
MGCAddSnippet(7, "The command descriptions for Calibre 3DSTACK statements use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(8, "The Calibre 3DSTACK tool uses the powerful and familiar set of verification and analysis features included with the Calibre nmDRC, Calibre nmLVS, Calibre RVE, and Calibre DESIGNrev products. Calibre 3DSTACK uses its own rule file format and commands, but the principles of operation are familiar to existing Calibre verification flows.");
MGCAddSnippet(9, "Invoke Calibre 3DSTACK in batch mode from the command line or from Calibre Interactive. The majority of rule file operations can be modified from Calibre Interactive 3DSTACK. After a run is complete, use Calibre RVE and Calibre DESIGNrev to view the results.");
MGCAddSnippet(10, "Command-line invocation arguments control the mode and operations performed by Calibre 3DSTACK.");
MGCAddSnippet(11, "Invoke the Calibre 3DSTACK GUI from the command line or from Calibre DESIGNrev. ");
MGCAddSnippet(12, "In order to run Calibre 3DSTACK, you must write a rule file that contains assembly and verification commands.  To perform a verification or to generate an assembly view, you invoke Calibre 3DSTACK with the rule file as an argument. You can view the physical assembly layout view in Calibre DESIGNrev and highlight rule check results from Calibre RVE.");
MGCAddSnippet(13, "Calibre 3DSTACK supports two rule file syntaxes: standard and extended (3DSTACK+). The extended syntax offers a more general approach to the assembly and verification of your stacked IC and is recommended for all rule files. ");
MGCAddSnippet(14, "You can perform a Calibre 3DSTACK verification run from the command line, Calibre DESIGNrev, or Calibre Interactive. ");
MGCAddSnippet(15, "You must have a complete rules file before running Calibre 3DSTACK from the command line.");
MGCAddSnippet(16, "You can set up and run a Calibre 3DSTACK verification from Calibre Interactive.");
MGCAddSnippet(17, "Calibre DESIGNrev includes a menu option to export your layout view from an active session to Calibre Interactive 3DSTACK. You can then perform a verification run directly from Calibre Interactive.");
MGCAddSnippet(18, "All output files are saved to your working directory during a Calibre 3DSTACK run. The transcript is updated in real-time.");
MGCAddSnippet(19, "Calibre 3DSTACK generates an overhead assembly view of your stacked package when you perform a verification run or when you invoke the tool with the ‑create_assembly option. You can also create an optional assembly view that displays the package in the x, y, and z dimensions.");
MGCAddSnippet(20, "You can view and analyze verification results produced by Calibre 3DSTACK using a combination of Calibre RVE and Calibre DESIGNrev. Reports in text format are also available after a run.");
MGCAddSnippet(21, "Use Calibre RVE to highlight DRC results from a Calibre 3DSTACK run. DRC results are produced by the geometrical rule checks in the 3DSTACK rule file. ");
MGCAddSnippet(22, "Use the cross-referencing capability provided by DFM databases in Calibre RVE to open and debug results from a Calibre 3DSTACK verification run.");
MGCAddSnippet(23, "Use the advanced debugging capability in Calibre RVE to view error results in Calibre 3DSTACK DFM databases.");
MGCAddSnippet(24, "Shorts can often be difficult to debug in the context of the whole design. Calibre 3DSTACK includes optional features that can help identify only the physical objects that are involved in a connectivity short.");
MGCAddSnippet(25, "Calibre RVE includes an Internal Schematic Viewer which displays a rendered schematic view for both source and layout. The Internal Schematic Viewer is disabled by default for Calibre 3DSTACK results viewing.");
MGCAddSnippet(26, "Results from a verification run are formatted with certain naming conventions.");
MGCAddSnippet(27, "Calibre Interactive 3DSTACK is a graphical interface to the Calibre 3DSTACK verification tool. It allows you to specify command line options and modify rule file statements that execute desired Calibre 3DSTACK operations.");
MGCAddSnippet(28, "Use Calibre Interactive to generate a netlist based on specified options if you do not have a complete source netlist for your 3D assembly.");
MGCAddSnippet(29, "Define and check a source netlist in Calibre Interactive. A source netlist defines the connectivity of your 3D IC. If a source netlist is specified, the connectivity can be traced and compared to the extracted layout netlist. This procedure is optional. ");
MGCAddSnippet(30, "Use Calibre Interactive to specify the path and location of the results database and Calibre 3DSTACK report file. Report files are very useful for debugging runs. This procedure is optional. ");
MGCAddSnippet(31, "You can specify the assembly instructions to apply at run time in Calibre Interactive. ");
MGCAddSnippet(32, "Use Calibre Interactive to select specific checks for a verification run.");
MGCAddSnippet(33, "Use Calibre Interactive to write a Calibre Interactive Customization settings file. ");
MGCAddSnippet(34, "Calibre Interactive provides the ability to specify and run pre- and post-execution internal triggers. A trigger can be any program or script executed from a shell.");
MGCAddSnippet(35, "The Calibre 3DSTACK rule file uses its own set of commands to assemble and verify your 3D-IC design intent. ");
MGCAddSnippet(36, "File format used to define the physical assembly of a 3D or 2.5D IC.");
MGCAddSnippet(37, "The 3DSTACK+ file format supports a set of system variables that allow you to easily reference layer placements based on the specified type.");
MGCAddSnippet(38, "The 3DSTACK+ rule file can contain system, assembly, and rule check commands. ");
MGCAddSnippet(39, "Defines a single die in the assembly. This statement includes a number of arguments that define the name, layout path, and layers.");
MGCAddSnippet(40, "Defines the name of the top-level cell for the 3D assembly.");
MGCAddSnippet(41, "Specifies the paths to LEF and DEF files, if a LEF/DEF layout system is used for the die or component. ");
MGCAddSnippet(42, "Specifies a layer in the die, component, or process. You can specify more than one layer by applying the -layer_info argument set multiple times. ");
MGCAddSnippet(43, "Defines a single component in the assembly. A component can be an object, such as a resistor, capacitor, or inductor, but it cannot be a die.");
MGCAddSnippet(44, "Defines the locations of objects in the assembly.");
MGCAddSnippet(45, "Defines explicit connectivity between die layers in a stack. This enables you to manually define connectivity between layers instead of using only the implicit connectivity provided by the physical assembly.");
MGCAddSnippet(46, "Specifies configuration information for the 3DSTACK+ syntax format rule file. The top cell name, source netlist, report file, connectivity, and other information can be specified. ");
MGCAddSnippet(47, "Defines the name of the top-level cell for the 3D assembly.");
MGCAddSnippet(48, "Specifies a layer properties file for Calibre DESIGNrev that sets custom layer visibility options.");
MGCAddSnippet(49, "Controls the case-sensitivity for the pins in layout. This option also controls case-sensitivity for pin mapping.");
MGCAddSnippet(50, "Imports a source netlist file used for connectivity comparison. It is highly recommended that you use a source netlist during the verification of your assembly.");
MGCAddSnippet(51, "Generates a report file that contains information about the verification run. This is useful for debugging the design.");
MGCAddSnippet(52, "Removes specified characters from the end of text labels.");
MGCAddSnippet(53, "Exports the connectivity information into a netlist file.");
MGCAddSnippet(54, "Specifies nets that can use a different name during connectivity checking. This command is useful for waiving known connectivity errors by adjusting net names at runtime.");
MGCAddSnippet(55, "Imports a text file that contains a list of net mapping statements.");
MGCAddSnippet(56, "Specifies pins that can use a different name during connectivity checking. This command is useful for waiving known connectivity errors by adjusting pin names in both the layout and source at runtime. ");
MGCAddSnippet(57, "Imports a text file that contains a list of pin mapping statements.");
MGCAddSnippet(58, "Specifies for all rule checks (except tvf_block) whether Calibre RVE layer highlights show only layers used to derive the rule check.");
MGCAddSnippet(59, "Specifies the path to a check text override file that controls how results are highlighted in Calibre RVE.");
MGCAddSnippet(60, "Includes a file containing SVRF Layout Input Exception Severity statements. If a line in the file does not contain a Layout Input Exception Severity statement, then the line is ignored.");
MGCAddSnippet(61, "Specifies the physical units used in the 3DSTACK+ rule file.");
MGCAddSnippet(62, "Specifies the severity level for warning messages.");
MGCAddSnippet(63, "Defines technology kit layer information for the dies, interposers, packages, and other components used in a 3D-IC. ");
MGCAddSnippet(64, "Generates an annotated GDS and extraction data for a specified portion of the assembly.");
MGCAddSnippet(65, "Rule check commands perform specific checks on your design during a verification run.");
MGCAddSnippet(66, "Checks for misaligned pads. ");
MGCAddSnippet(67, "Checks for connectivity between connected shapes when there is a source netlist present. When no source netlist is present, it checks for matching text strings on connected shapes. ");
MGCAddSnippet(68, "Exports specified layer contents. ");
MGCAddSnippet(69, "Defines custom checks using TVF format for the 3DSTACK+ syntax.");
MGCAddSnippet(70, "Checks for placed ports that do not have physical connectivity on a specified placement or layer type. ");
MGCAddSnippet(71, "Checks for orphan ports that are missing text labels.");
MGCAddSnippet(72, "Checks for density constraints on specified placements. ");
MGCAddSnippet(73, "Checks for sufficient separation distance between the exterior-facing sides of the first placement s edges and the interior-facing sides of the second placement s edges.");
MGCAddSnippet(74, "Checks for sufficient separation distance between the exterior-facing sides of the first placement s edges and the exterior-facing sides of the second placement s edges.");
MGCAddSnippet(75, "Checks for missing ports in the source (or extra ports in the layout) on a specified chip, placement, die or layer.");
MGCAddSnippet(76, "Checks for pads of a layer type or stack that do not overlap any other pads from other dies or interposers in the stack.");
MGCAddSnippet(77, "Checks for text labels that are not attached to any geometry on a specified chip, placement, die or layer.");
MGCAddSnippet(78, "Checks for sufficient separation distance between the interior-facing sides of the first placement s edges and the interior-facing sides of the second placement s edges.");
MGCAddSnippet(79, "Checks the location of pads and that the shape and text match between source and layout. ");
MGCAddSnippet(80, "Checks for ports in the source netlist that have no corresponding layout pad on a specified chip, placement, die or layer.");
MGCAddSnippet(81, "Checks for multiple text labels attached to the same pad on a specified chip, placement, die or layer. In the case where multiple text labels overlap a pad in the layout, the tool generates a multi-text error and chooses to use one of the text labels attached to the pad for the connectivity analysis. Because the chosen label may not match your design intent, it is important to review and resolve all multi-text errors to ensure that the layout is correct. If you do not resolve the multi-text errors, your connectivity analysis may not be correct.");
MGCAddSnippet(82, "Checks for missing text labels for pads on a specified chip, placement, die or layer.");
MGCAddSnippet(83, "Checks for pad centers that are not aligned to a specified grid.");
MGCAddSnippet(84, "Checks for sufficient overlap between two placed layers. ");
MGCAddSnippet(85, "Compares the sizes of interacting pads and reports mismatches. Use this command to ensure that the pads of two connected dies are of the same size.");
MGCAddSnippet(86, "Selects specified checks to execute during a Calibre 3DSTACK verification.");
MGCAddSnippet(87, "Reports ports that are both not connected to any other port in the layout and in the source netlist.A source netlist is required. ");
MGCAddSnippet(88, "Selects specified checks not to execute during a Calibre 3DSTACK verification.");
MGCAddSnippet(89, "Defines a code block in which standard Calibre 3DSTACK rule file format commands can be specified. This command allows you to directly pass standard 3DSTACK syntax commands to the Calibre 3DSTACK run.");
MGCAddSnippet(90, "Check text override comments allow additional control over how results are displayed in Calibre RVE. Check text override comments can be specified as options to certain rule check commands. ");
MGCAddSnippet(91, "Calibre 3DSTACK includes utilities that allow you to convert other layout or CSV files into supported formats. The spreadsheet conversion utilities and AIF conversion utilities are commands within the Calibre YieldServer tool.");
MGCAddSnippet(92, "The System Netlist Generator is included in the Calibre installation package and is used to create a source netlist for a multi-chip design. The tool is invoked separately to Calibre 3DSTACK and includes its own set of commands and a graphical interface.");
MGCAddSnippet(93, "The System Netlist Generator allows you to easily create source netlists for complex stacked systems. It supports batch and interactive modes. ");
MGCAddSnippet(94, "The System Netlist Generator can be invoked from Calibre Interactive to generate a netlist from an existing rule file or it can be used in a stand-alone flow. ");
MGCAddSnippet(95, "Invocation arguments for the System Netlist Generator control the startup mode and operation of the tool.");
MGCAddSnippet(96, "The graphical interface for the System Netlist Generator includes most of the batch command functionality. ");
MGCAddSnippet(97, "The graphical interface includes a number of features that allow you to quickly edit your design.");
MGCAddSnippet(98, "System Netlist Generator Main Window.");
MGCAddSnippet(99, "Shows detailed properties about objects in the design tree.");
MGCAddSnippet(100, "Controls how net names are generated when port connections are assigned.");
MGCAddSnippet(101, "The System Netlist Generator configuration file allows you to define placements and connectivity for your 3D-IC and then export the definitions to a new netlist file.");
MGCAddSnippet(102, "Imports chips and creates placements.");
MGCAddSnippet(103, "Connects specified pins with new nets.");
MGCAddSnippet(104, "Exports the connectivity and placements defined in the configuration file to a netlist file.");
MGCAddSnippet(105, "A set of batch commands are supported by the System Netlist Generator. ");
MGCAddSnippet(106, "Creates a journal file in your working directory while the System Netlist Generator tool is running. No journal is created if this command is not specified.");
MGCAddSnippet(107, "Exports the current project to a file.");
MGCAddSnippet(108, "Exports specified chip definitions or the complete assembly to a netlist file.");
MGCAddSnippet(109, "Creates a new project.");
MGCAddSnippet(110, "Opens the specified project.");
MGCAddSnippet(111, "Saves the current state of the project.");
MGCAddSnippet(112, "Applies a filter to a specified iterator. This command is supported in batch mode only.");
MGCAddSnippet(113, "Moves the specified iterator to the first element of the container.");
MGCAddSnippet(114, "Returns an iterator for all buses defined in the specified chip.");
MGCAddSnippet(115, "Returns an iterator for all chips defined in the current project.");
MGCAddSnippet(116, "Returns an iterator used to access any created nets in the current project.");
MGCAddSnippet(117, "Returns an iterator for all pins on the specified chip.");
MGCAddSnippet(118, "Returns an iterator for all placements defined in the current project.");
MGCAddSnippet(119, "Returns an iterator for all ports defined for the specified placement.");
MGCAddSnippet(120, "Returns a list of property values for the specified iterator.");
MGCAddSnippet(121, "Returns a list of property names.");
MGCAddSnippet(122, "Increments the specified iterator.");
MGCAddSnippet(123, "Changes the value of specified properties.");
MGCAddSnippet(124, "Sorts the elements of a list and returns a new sorted list to an iterator.");
MGCAddSnippet(125, "Adds a pin to the specified chip.");
MGCAddSnippet(126, "Creates a new connection.");
MGCAddSnippet(127, "Creates a new chip.");
MGCAddSnippet(128, "Creates a new placement.");
MGCAddSnippet(129, "Imports an existing chip definition.");
MGCAddSnippet(130, "Removes the selected chip definition.");
MGCAddSnippet(131, "Deletes a pin from the specified chip.");
MGCAddSnippet(132, "Removes a placement from the project.");
MGCAddSnippet(133, "Sets the net name template.");
MGCAddSnippet(134, "Deletes specified connections or ports from a net.");
MGCAddSnippet(135, "Calibre 3DSTACK includes three utilities that allow you to convert AIF designs to OASIS and GDS layouts, and SPICE netlists.");
MGCAddSnippet(136, "The AIF converters are invoked on the Calibre command-line. Not all AIF sections are used by Calibre 3DSTACK.");
MGCAddSnippet(137, "Calibre 3DSTACK can export the netlist of the layout assembly in AIF format, among others.");
MGCAddSnippet(138, "Reads an AIF file and exports a GDS layout file.");
MGCAddSnippet(139, "Reads an AIF file and exports an OASIS layout file.");
MGCAddSnippet(140, "Reads an AIF file and exports a SPICE netlist file.");
MGCAddSnippet(141, "You can convert CSV-formatted spreadsheets into SPICE or GDS and OASIS for use in Calibre 3DSTACK assembly and verification flows.");
MGCAddSnippet(142, "Creates GDS layouts that include pin and die boundary locations from a spreadsheet (CSV) file.");
MGCAddSnippet(143, "Creates OASIS layouts that include pin and die boundary locations from a spreadsheet (CSV) file.");
MGCAddSnippet(144, "Converts a CSV input file to a SPICE netlist.");
MGCAddSnippet(145, "Creates GDS layouts that include pin and die boundary locations from a CSV file generated by the Mentor Graphics Xpedition® Substrate Integrator tool.");
MGCAddSnippet(146, "Creates OASIS layouts that include pin and die boundary locations from a CSV file generated by the Mentor Graphics Xpedition® Substrate Integrator tool.");
MGCAddSnippet(147, "Creates a SPICE netlist from a CSV file generated by the Mentor Graphics Xpedition® Substrate Integrator tool.");
MGCAddSnippet(148, "The Calibre 3DSTACK rule file contains assembly operations that build a model of your 3D-IC and a set of verification rules. This section contains rule file examples and a complete walk-through of the Calibre 3DSTACK flow.");
MGCAddSnippet(149, "This example steps you through the complete flow for creating a new rule file for your 3D-IC.");
MGCAddSnippet(150, "The design used in this example is a 2.5D IC that consists of a memory controller and two identical ram dies stacked on a silicon interposer.");
MGCAddSnippet(151, "Before you verify your 3D-IC with Calibre 3DSTACK, you must complete your layout and verify each die in the stack. The layout is usually performed with a combination of full custom layout tools and digital place and route tools.");
MGCAddSnippet(152, "Create a new extended syntax rule file. The Calibre 3DSTACK rule file is a text file that defines run options, chips, assembly operations, and verification checks. ");
MGCAddSnippet(153, "Before writing any rule checks for your 3D-IC, you must define the layouts, layers, location, and text for the dies, and the layer connectivity. These rule file components are called assembly operations.");
MGCAddSnippet(154, "The rule file supports a configuration command that sets up global properties and settings for the Calibre 3DSTACK assembly and verification process.");
MGCAddSnippet(155, "The first assembly operation in your rule file flow is to define the layouts that compose your 3D-IC. ");
MGCAddSnippet(156, "You must define all layers used in the assembly and verification of your 3D-IC. If your layout files include detailed placement and routing, at a minimum, you only need to define the interface layers used to connect the dies in the stack. This is referred to as a black-box verification flow. You can perform full white-box verification flow if you define all layers in your layout files.");
MGCAddSnippet(157, "You must define layer interactions and connectivity within each die before assembling the 3D‑IC.");
MGCAddSnippet(158, "Assemble the 3D-IC by placing, rotating, and arranging the chips. This is the first physical action in the rule file. The coordinates of each die should be made available by the layout designer.");
MGCAddSnippet(159, "LVS and DRC rules are written using Calibre 3DSTACK rule file commands. ");
MGCAddSnippet(160, "Connectivity checks are performed on your 3D-IC using the placement information, source netlist connectivity, assembly connect statements, and attached text.");
MGCAddSnippet(161, "Calibre 3DSTACK includes a number of physical checks that operate similar to SVRF spacing checks. It is recommended that you use the internal Calibre 3DSTACK commands to check for spacing violations.");
MGCAddSnippet(162, "If a chip is placed slightly off of its target, or the geometry of the pads do not match exactly between chips, the pads may still be electrically connected, but not acceptable for manufacturing. The overlap tolerance must be checked to avoid false connected check reports.");
MGCAddSnippet(163, "Create a source netlist for an interposer design using the System Netlist Generator GUI. Design data is included.");
MGCAddSnippet(164, "Launch the System Netlist Generator GUI and create a new project. ");
MGCAddSnippet(165, "Import SPICE netlists and create chips for the design.");
MGCAddSnippet(166, "Modify pins on chip definitions. ");
MGCAddSnippet(167, "Create placements, or instantiations, of your chips in the System Netlist Generator project.");
MGCAddSnippet(168, "Electrically connect the placements in your design by defining and assigning nets in the database.");
MGCAddSnippet(169, "Export the completed source netlist from the System Netlist Generator.");
MGCAddSnippet(170, "The extended syntax is recommended for all new rule files.");
MGCAddSnippet(171, "Extended syntax rule files are more flexible than conventional Calibre 3DSTACK rule files because the assembly operations can be separate from the rules. ");
MGCAddSnippet(172, "A typical example using the conventional Calibre 3DSTACK rule file syntax.");
MGCAddSnippet(173, "Simplified method for creating regular assemblies and connectivity checks using the conventional Calibre 3DSTACK rule file syntax.");
MGCAddSnippet(174, "The Calibre 3DSTACK report file is generated using the report command. ");
MGCAddSnippet(175, "The report begins with a summary of the input, output, user, and design information.");
MGCAddSnippet(176, "The report summarizes the layers, placements, and text that were specified in your rule file.");
MGCAddSnippet(177, "Verification check results are reported under the RULECHECK SUMMARY section.");
MGCAddSnippet(178, "The standard (or traditional) Calibre 3DSTACK rule file syntax supports a different set of assembly and system configuration commands than the extended 3DSTACK+ syntax. ");
MGCAddSnippet(179, "System and miscellaneous commands specify the verification inputs, outputs, and run control options.");
MGCAddSnippet(180, "Sets the severity of circular GDS path extension errors.");
MGCAddSnippet(181, "Exports the connectivity information into a netlist or annotated GDS file.");
MGCAddSnippet(182, "Generates an annotated GDS of a specified portion of the assembly, including the layers of the specified placements.");
MGCAddSnippet(183, "Exports a specified chip or placement from the stack into a GDS or OASIS file.");
MGCAddSnippet(184, "Specifies a layer properties file for Calibre DESIGNrev that sets custom layer visibility options.");
MGCAddSnippet(185, "Generates a report file that contains information about the verification run. This is useful for debugging the design.");
MGCAddSnippet(186, "Runs Calibre using the specified rule file and command-line options.");
MGCAddSnippet(187, "Sets the syntax version of the Calibre 3DSTACK rule file.");
MGCAddSnippet(188, "Applies filtering options to the imported source netlist file.");
MGCAddSnippet(189, "Imports a source netlist file used for connectivity comparison. It is highly recommended that you use a source netlist during the verification of your assembly.");
MGCAddSnippet(190, "Includes a file containing SVRF statements in the run.");
MGCAddSnippet(191, "Specifies the severity level for warning messages.");
MGCAddSnippet(192, "Assembly commands allow you to build a physical model of your stacked IC.");
MGCAddSnippet(193, "Defines an anchor name and location for a chip. This is helpful during the assembly of the stack.");
MGCAddSnippet(194, "Attaches text to a placed layer for connectivity extraction and checking.");
MGCAddSnippet(195, "Specifies electrical connections among input layer objects.");
MGCAddSnippet(196, "Specifies electrical connectivity for layers that you want to use with connectivity-based SVRF operations, such as Net Area Ratio. This is equivalent to the die -wb_connect -use_in_svrf extended syntax option.");
MGCAddSnippet(197, "Excludes specified pins from a Calibre 3DSTACK run.");
MGCAddSnippet(198, "Removes specified characters from the end of text labels.");
MGCAddSnippet(199, "Imports a text file that contains a list of net mapping statements.");
MGCAddSnippet(200, "Imports a text file that contains a list of pin mapping statements.");
MGCAddSnippet(201, "Imports text objects from a file and applies them to a specified chip.");
MGCAddSnippet(202, "Defines an original or derived layer in the assembly.");
MGCAddSnippet(203, "Imports a GDS or OASIS database that contains a chip used in the assembly.");
MGCAddSnippet(204, "Defines the case-sensitivity of the top-level assembly layout.");
MGCAddSnippet(205, "Defines the name of the top-level cell for the 3D assembly.");
MGCAddSnippet(206, "Associates layout placements in the assembly to placements specified in the source netlist file.");
MGCAddSnippet(207, "Specifies nets that can use a different name during connectivity checking. This command is useful for waiving known connectivity errors by adjusting net names at runtime.");
MGCAddSnippet(208, "Specifies pins that can use a different name during connectivity checking. This command is useful for waiving known connectivity errors by adjusting pin names at runtime. This operation does not rename pins in the layout.");
MGCAddSnippet(209, "Specifies that certain pins on a chip are interchangeable during connectivity checking.");
MGCAddSnippet(210, "Defines the placement name, orientation, and scaling factor for a chip.");
MGCAddSnippet(211, "Defines the placement name, orientation, and scaling factor for a layer.");
MGCAddSnippet(212, "Edits existing layout text in the assembly.");
MGCAddSnippet(213, "The standard syntax supports the same set of rules as the extended syntax, but the options and usage of the rules is different.");
MGCAddSnippet(214, "Specifies for all rule checks (except tvf_block) whether Calibre RVE layer highlights show only layers used to derive the rule check.");
MGCAddSnippet(215, "Specifies the path to a check text override file that controls how results are highlighted in Calibre RVE.");
MGCAddSnippet(216, "Defines custom checks for the Calibre 3DSTACK rule file.");
MGCAddSnippet(217, "Error and warning messages are generated by the Calibre 3DSTACK tool at run time. ");
MGCAddSnippet(218, "Error messages must be corrected to continue a Calibre 3DSTACK run.");
MGCAddSnippet(219, "Warning messages should be reviewed to determine if they indicate a real problem in your design. Calibre 3DSTACK writes all warning messages issued during a run to your working directory in a file named 3dstack.warnings.");
MGCAddSnippet(220, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

